import React from 'react'
import {Container,Formulario,Conteudo} from '../styles/stylesPage/cadastroStyles'
import Imput from './inputs/input'
import Link from 'next/link'
import * as Yup from 'yup'
import { Formik, Form, Field, ErrorMessage } from 'formik';
const avaliar = Yup.object().shape({
    name: Yup.string().min(3,"").required(),
    password: Yup.string().min(8, "").required().max(15, 'A quantidade máxima é 15'),
    email: Yup.string().email().required(),
    // nacionalidade_guia:Yup.string().required(t('FieldRequired')),
    confirmPassword: Yup.string().oneOf([Yup.ref('senha_guia'), null]," ").required(),
     // idade_guia:Yup.number().moreThan(17,t('AgeInputError')).required(t('FieldRequired')),
     // telefone_guia: Yup.string().required(t('FieldRequired'))
  })
  async function CadastroElementos (values) {
    const data = {
      nome_guia: values.nome_guia,
      email_guia: values.email_guia,
      senha_guia: values.senha_guia,
     
     
    }
    /** caso tenha algum problema com a conexão mostra o erro específico */
    try {
      const response = await api.post('guia', data)
      alert(JSON.stringify(response.data.message))
      history.push('/login')
    } catch (err) {
      // alert('Erro no estabelecer conexão. ' + err.response.data.message)
      console.log(data)
      alert('Erro no estabelecer conexão. ' + err)
    }
  }
const Cadastro : React.FC=()=>{
    return(
           <Container>
               <Conteudo>
s
                </Conteudo>
    <Formulario>
    <Formik
       initialValues={{ email: '', password: '' }}
       validationSchema={avaliar}
       onSubmit={(values) => {
            CadastroElementos(values)
       }}
     >
       {({values, dirty, isValid, handleChange,isSubmitting}) => (
         <Form>
             <bodyForm>

           <Field type="text" name="name" as={Imput} className="formCampo"/>
           <ErrorMessage name="name" component="div" className="formCampo" />
           <Field type="email" name="email" as={Imput} className="formCampo"/>
           <ErrorMessage name="email" component="div" className="formCampo" />
           <Field type="password" name="password" as={Imput} className="formCampo"/>
           <ErrorMessage name="password" component="div" className="formCampo"/>
           <Field type="password" name="confirmPassword" as={Imput} className="formCampo"/>
           <ErrorMessage name="password" component="div" className="formCampo"/>

           <button type="submit" disabled={isSubmitting}>
             Submit
           </button>
           </bodyForm>
         </Form>
       )}
     </Formik> 
     <Link href='/'>
                   <a>Login</a>
    </Link>
    </Formulario>
             
            </Container>
    )
}
export default Cadastro
